void Recovery::rpthing()
{
	Menu::Title("");
	Menu::SubTitle("RP Options");
	if (Menu::Option("RP Correction Character 1")) 
	{
		int rank = NumberKeyboard27();
		if (rank <= 8000 && rank > 0) {
			Foxy_Engine::stat_set_int($("MP0_CHAR_SET_RP_GIFT_ADMIN"), Levels[(rank - 1)], 1);
			notifyMap("Change session to apply");
		}
	}
	if (Menu::Option("RP Correction Character 2")) {
		int rank = NumberKeyboard27();
		if (rank <= 8000 && rank > 0) {
			Foxy_Engine::stat_set_int($("MP1_CHAR_SET_RP_GIFT_ADMIN"), Levels[(rank - 1)], 1);
			notifyMap("Change session to apply");
		}
	}
	if (Menu::Option("RP Instant Character 1")) {
		int rank = NumberKeyboard27();
		if (rank <= 8000 && rank > 0) {
			Foxy_Engine::stat_set_int($("MP0_CHAR_XP_FM"), Levels[(rank - 1)], 1);
			notifyMap("Rp Apply");
		}
	}
	if (Menu::Option("RP Instant Character 2")) {
		int rank = NumberKeyboard27();
		if (rank <= 8000 && rank > 0) {
			Foxy_Engine::stat_set_int($("MP1_CHAR_XP_FM"), Levels[(rank - 1)], 1);
			notifyMap("Rp Apply");
		}
	}
	Menu::Toggle("Safe Rp Loop", Recovery::saferp);
	if (Menu::Option("Crew RP Instant")) {
		int rank = NumberKeyboard27();
		if (rank <= 8000 && rank > 0) {
			Foxy_Engine::stat_set_int($("MPPLY_CREW_LOCAL_XP_0"), Levels[(rank - 1)], true);
			Foxy_Engine::stat_set_int($("MPPLY_CREW_LOCAL_XP_1"), Levels[(rank - 1)], true);
			Foxy_Engine::stat_set_int($("MPPLY_CREW_LOCAL_XP_2"), Levels[(rank - 1)], true);
			Foxy_Engine::stat_set_int($("MPPLY_CREW_LOCAL_XP_3"), Levels[(rank - 1)], true);
			Foxy_Engine::stat_set_int($("MPPLY_CREW_LOCAL_XP_4"), Levels[(rank - 1)], true);
			notifyMap("Rp Apply");
		}
	}
	//if (Menu::Option("RemoteRecovery")) {
	//	Give2Bi();
	//}
}


